import { Link } from "react-router-dom";
import '../index.css'

const Navigation = () => {
    return (
        <ul className="main-navigation">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/product">Products</Link></li>
        </ul>
    )
}

export default Navigation;
